'''
Solution idea: use a stack.
'''

TEST = 'dabAcCaCBAcCcaDA'
DATA = ''


def _eliminate(stack):
    while len(stack) > 1:
        a = stack.pop()
        b = stack.pop()
        should_eliminate = (a != b and a.lower() == b.lower())
        if not should_eliminate:
            stack.append(b)
            stack.append(a)
            return


def reduce(s):
    lst = []
    for i in range(len(s)):
        lst.append(s[i])
        _eliminate(lst)
    s_reduced = ''.join(lst)
    return s_reduced


if __name__ == '__main__':
    assert 'dabCBAcaDA' == reduce(TEST)
    print(len(reduce(DATA)))
